import React from 'react';
import '../styles/ControlPanel.css';

const ControlPanel = ({ onFilter }) => {
    return (
        <div className="control-panel">
            <h2>Control Panel</h2>
            <button onClick={() => onFilter('All')}>Show All</button>
            <button onClick={() => onFilter('High')}>Filter High</button>
            <button onClick={() => onFilter('Moderate')}>Filter Moderate</button>
            <button onClick={() => onFilter('Low')}>Filter Low</button>
        </div>
    );
};

export default ControlPanel;
